  var n2;
  var sum;
  var i;
  for (var i = 0;i < num.length;i++) {
    n1 = Number(num.substr(i, 1));
    n2 = Number(ts_id.substr(i, 1));
    sum = String(n1 + n2);
    out = out + sum.substr(sum.length - 1);
  }
  return out;
