chatango.users.User.prototype.onProfileCssLoad_ = function(e) {
  if (chatango.DEBUG) {
    this.logger.info("Profile CSS Loaded");
  }
  var xhr = e.currentTarget;
  var loadedCss = xhr.getResponse();
  loadedCss = loadedCss.replace(/[\n\t\r]/g, " ").replace(/  +/g, " ");
  this.profileBgStyle_ = {backgroundColor:"", backgroundImage:"", backgroundRepeat:"", color:""};
  try {
    style = loadedCss.match(/body { *([\S\s]+?) *}/)[1];
    this.profileBgStyle_.backgroundColor = style.match(/background-color: (.+?);/)[1] || "";
    this.profileBgStyle_.backgroundImage = style.match(/background-image: (.+?);/)[1] || "";
    this.profileBgStyle_.backgroundRepeat = style.match(/background-repeat: (.+?);/)[1] || "";
    this.profileBgStyle_.color = style.match(/[^\-]color: (.+?);/)[1] || "";
  } catch (e) {
    if (chatango.DEBUG) {
      this.logger.info("Profile CSS was empty.");
    }
  }
  this.ProfileCssState_ = chatango.utils.LoadState.LOADED;
  this.dispatchEvent(chatango.users.User.EventType.PROFILE_CSS_LOADED);
};
chatango.users.User.prototype.onProfileCssLoadError_ = function(e) {
  if (chatango.DEBUG) {
    goog.debug.Logger.getLogger("chatango.users.User").warning("Profile CSS Load Error");
  }
  this.ProfileCssState_ = chatango.utils.LoadState.NONE;
  this.handler.unlisten(e.currentTarget, [goog.net.EventType.ABORT, goog.net.EventType.TIMEOUT, goog.net.EventType.ERROR]);
  this.dispatchEvent(chatango.users.User.EventType.PROFILE_CSS_LOAD_ERROR);
};
