chatango.users.UserManager.UserInfo;
chatango.users.UserManager = function() {
  goog.events.EventTarget.call(this);
  this.users = {};
  this.pmAnonCount_ = 0;
};
goog.inherits(chatango.users.UserManager, goog.events.EventTarget);
goog.addSingletonGetter(chatango.users.UserManager);
chatango.users.UserManager.prototype.logger = goog.debug.Logger.getLogger("chatango.users.UserManager");
chatango.users.UserManager.prototype.addUser = function(referrerId, uid, type, cookie, noCache) {
  var uidLC = uid.toLowerCase();
  var userKey = this.getKey(uidLC, type);
  var userInfo = goog.object.get(this.users, userKey);
  var res;
  if (userInfo !== undefined) {
    goog.array.insert(userInfo.referrers, referrerId);
    if (noCache) {
      userInfo.user.loadMediaInfo(true);
    }
    res = userInfo.user;
  } else {
    var pmAnonName;
    if (uid.charAt(0) == "*") {
      this.pmAnonCount_ += 1;
      pmAnonName = "Anon" + this.pmAnonCount_;
    }
    res = new chatango.users.User(uid, type, cookie, pmAnonName);
    goog.object.add(this.users, userKey, {user:res, referrers:[referrerId]});
  }
  return res;
};
chatango.users.UserManager.prototype.getKey = function(uid, opt_type) {
  uid = uid.toLowerCase();
  var result = !opt_type || opt_type == chatango.users.User.UserType.SELLER ? uid : opt_type + "-" + uid;
  return result;
};
chatango.users.UserManager.prototype.addCurrentUser = function(referrerId, uid, type, cookie) {
  if (this.currentUser) {
    this.currentUser.setCurrentUser(false);
  }
  if (uid) {
    this.currentUser = this.addUser(referrerId, uid, type, cookie);
  } else {
    this.currentUser = new chatango.users.User(null, type, null);
  }
  this.currentUser.setCurrentUser(true);
  this.dispatchEvent(chatango.events.EventType.USER_CHANGED);
};
chatango.users.UserManager.prototype.removeUser = function(referrerId, uid, opt_type) {
  uid = uid.toLowerCase();
  var userKey = this.getKey(uid, opt_type);
  var userInfo = goog.object.get(this.users, userKey);
  if (userInfo === undefined) {
    if (chatango.DEBUG) {
      console.info("removeUser() called for nonexistant uid: " + uid);
    }
    return;
  }
  if (!goog.array.remove(userInfo.referrers, referrerId)) {
    if (chatango.DEBUG) {
      console.info("removeUser() called for nonexistant (uid,referrerId) pair: (" + uid + "," + referrerId + ")");
    }
  }
  if (userInfo.referrers.length == 0) {
    goog.object.remove(this.users, userKey);
  }
};
chatango.users.UserManager.prototype.getUser = function(uid, opt_type) {
  var userInfo;
  uid = uid.toLowerCase();
  var userKey = this.getKey(uid, opt_type);
  userInfo = goog.object.get(this.users, userKey, null);
  if (userInfo == null) {
    if (chatango.DEBUG) {
      console.log("No user for uid: " + uid);
    }
    return null;
  }
  return userInfo.user;
};
chatango.users.UserManager.prototype.refreshMedia = function(sid) {
  var user = this.getUser(sid);
  if (user) {
    user.loadMediaInfo(true);
  }
};
chatango.users.UserManager.prototype.signup = function(e) {
  this.request_ = e.getRequest();
  this.managers_ = chatango.managers.ManagerManager.getInstance();
  var groupInfo = null;
  if (chatango.group.GroupInfo) {
    groupInfo = this.managers_.getManager(chatango.group.GroupInfo.ManagerType);
  }
  var query = "";
  query += "email=" + this.request_.getEmail();
  query += "&login=" + this.request_.getName();
  query += "&password=" + this.request_.getPassword();
  query += "&password_confirm=" + this.request_.getPassword();
  query += "&checkerrors=yes";
  if (groupInfo) {
    query += "&group_url=" + groupInfo.getGroupHandle();
    query += "&group_title=" + groupInfo.getGroupTitle();
  }
  var url = chatango.settings.servers.SubDomain.getInstance().getScriptsStDomain() + "/signuptag";
  var headers = {"Content-type":"application/x-www-form-urlencoded"};
  var xhr = chatango.networking.RequestFactory.getInstance().makeRequest(url);
  xhr.setWithCredentials(true);
  goog.events.listen(xhr, goog.net.EventType.SUCCESS, this.onSignupSuccess, undefined, this);
  goog.events.listen(xhr, [goog.net.EventType.ERROR, goog.net.EventType.TIMEOUT, goog.net.EventType.ABORT], this.onSignupError, undefined, this);
  xhr.send(url, "POST", query, headers);
};
chatango.users.UserManager.prototype.onSignupSuccess = function(e) {
  var xhr = e.currentTarget;
  var t = xhr.getResponseText();
  var ev;
  if (t.match(/error_msg/)) {
    var error_msg = t.match(/error_msg=(.*?)&/)[1];
    ev = new chatango.login.SignupResponseEvent(chatango.login.SignupResponseEvent.EventType.ERROR, error_msg);
  } else {
    ev = new chatango.login.SignupResponseEvent(chatango.login.SignupResponseEvent.EventType.SUCCESS);
    var sm = chatango.externalapi.SolveMedia.getInstance();
    sm.insertSolveMediaTag(this.request_.getEmail());
  }
  this.request_.dispatchEvent(ev);
};
chatango.users.UserManager.prototype.onSignupError = function(e) {
  this.request_.dispatchEvent(new chatango.login.SignupResponseEvent(chatango.login.SignupResponseEvent.EventType.ERROR));
};
