goog.provide("chatango.utils.style");
goog.require("goog.style");
chatango.utils.style.Position = {LEFT:"left", RIGHT:"right", TOP:"top", BOTTOM:"bottom"};
chatango.utils.style.stretchToFill = function(element) {
  var parent = element.parentNode;
  var parentSize = goog.style.getSize(parent);
  var parentPadding = goog.style.getPaddingBox(parent);
  var border = goog.style.getBorderBox(element);
  var padding = goog.style.getPaddingBox(element);
  var margin = goog.style.getMarginBox(element);
  var ppl = parentPadding.left;
  if (isNaN(ppl)) {
    ppl = 0;
  }
  var ppr = parentPadding.right;
  if (isNaN(ppr)) {
    ppr = 0;
  }
  var available = parentSize.width - ppl - ppr;
  var mpb = margin.left + margin.right + border.left + border.right;
  var hpad = padding.left + padding.right;
  var width = Math.round(available - mpb - hpad);
  element.style.width = width + "px";
};
chatango.utils.style.getPositionValue = function(el, position) {
  var pos = goog.style.getComputedStyle(el, position);
  if (pos != "") {
    return parseFloat(pos.match(/[-\d.]+/)[0]);
  } else {
    pos = el.style[position];
    if (pos != "") {
      return parseFloat(pos.match(/[-\d.]+/)[0]);
    } else {
      return 0;
    }
  }
};
