  path.lineTo(x + w, y + h - r);
  path.curveTo(x + w, y + h - r + c, x + w - r + c, y + h, x + w - r, y + h);
  path.lineTo(x + r, y + h);
  path.curveTo(x + r - c, y + h, x, y + h - r + c, x, y + h - r);
