chatango.managers.LanguageManager.prototype.getBaseLang = function() {
  return this.lang_.substr(0, 2);
};
chatango.managers.LanguageManager.prototype.getStringPack = function(pack_id, english_strs, callback_function, scope) {
  var pack_name = pack_id;
  if (this.getBaseLang() == "en") {
    this.packs_[pack_name] = english_strs;
    this.packs_[pack_name].packLoaded = true;
    callback_function.apply(scope, [pack_name]);
    return;
  }
  var packLoaded = function(e) {
    var myhr = e.currentTarget;
    var dom = myhr.getResponseXml();
    arr = dom.getElementsByTagName("str");
    var loadedStringsObj = new Object;
    for (var i = 0;i < arr.length;i++) {
      if (arr[i].firstChild) {
        loadedStringsObj[arr[i].getAttribute("id")] = arr[i].firstChild.nodeValue;
      } else {
        loadedStringsObj[arr[i].getAttribute("id")] = "";
      }
    }
    this.packs_[pack_name] = this.mergePacks(this.packs_[pack_name], loadedStringsObj);
    this.packs_[pack_name].packLoaded = true;
    this.packs_[pack_name].loaderDeferred.callback(pack_name);
    e.target.dispose();
  };
  var packLoaderError = function(e) {
    this.packs_[pack_name].packLoaded = true;
    this.packs_[pack_name].loaderDeferred.callback({});
    e.target.dispose();
  };
  if (this.packs_[pack_name]) {
    if (this.packs_[pack_name].loaderDeferred.hasFired()) {
      callback_function.apply(scope, [pack_name]);
    } else {
      this.packs_[pack_name].loaderDeferred.addCallback(callback_function, scope);
    }
  } else {
    var pack_url = this.path + pack_name + "_" + this.getBaseLang() + ".xml";
    var xhr = (new chatango.networking.RequestFactory.getInstance).makeRequest(pack_url);
    goog.events.listenOnce(xhr, goog.net.EventType.SUCCESS, packLoaded, undefined, this);
    goog.events.listenOnce(xhr, [goog.net.EventType.ERROR, goog.net.EventType.ABORT, goog.net.EventType.TIMEOUT], packLoaderError, undefined, this);
    this.packs_[pack_name] = english_strs;
    this.packs_[pack_name].loaderDeferred = new goog.async.Deferred;
    this.packs_[pack_name].loaderDeferred.addCallback(callback_function, scope);
    xhr.send(pack_url);
  }
};
chatango.managers.LanguageManager.prototype.mergePacks = function(pack_a, pack_b) {
  var new_pack = new Object;
  for (var i in pack_a) {
    if (pack_b[i]) {
      new_pack[i] = pack_b[i];
    } else {
      new_pack[i] = pack_a[i];
    }
  }
  for (var i in pack_b) {
    if (!new_pack[i]) {
      new_pack[i] = pack_b[i];
    }
  }
  return new_pack;
};
chatango.managers.LanguageManager.prototype.getString = function(pack_id, string_id) {
  var str = "";
  var pack = this.packs_[pack_id];
  if (pack) {
    str = this.packs_[pack_id][string_id] ? this.packs_[pack_id][string_id] : "";
  }
  return str;
};
chatango.managers.LanguageManager.prototype.isPackLoaded = function(pack_id) {
  var pack = this.packs_[pack_id];
  if (!pack) {
    return false;
  }
  if (!pack.packLoaded) {
    return false;
  }
  return true;
};
