chatango.audio.AudioController.prototype.playUrl = function(url, stream, opt_initSoundClick) {
  if (!this.groupStreamEnabled_ && stream == chatango.audio.AudioController.Streams.GROUP_STREAM) {
    return;
  }
  if (chatango.managers.Environment.getInstance().isMockGroup()) {
    return;
  }
  var key = goog.json.serialize(url);
  var audio = this.map_[key];
  if (!audio) {
    audio = goog.dom.createDom("audio");
    if (typeof url == "string") {
      var srcUrl = url + "?" + chatango.audio.AudioController.Version;
      goog.dom.append(audio, goog.dom.createDom("source", {"src":srcUrl}));
    } else {
      if (url.length) {
        var i;
        for (i = 0;i < url.length;i++) {
          var srcUrl = url[i] + "?" + chatango.audio.AudioController.Version;
          goog.dom.append(audio, goog.dom.createDom("source", {"src":srcUrl}));
        }
      }
    }
    this.map_[key] = audio;
  }
  try {
    audio.volume = this.model_.getVolume();
    var muted = this.model_.getMuted();
    var isReplySound = url === chatango.audio.AudioController.AlertType.REPLY_NOTIFICATION;
    var replySoundsAllowed = this.model_.getAllowReplySounds();
    var soundPermitted = !muted || isReplySound && replySoundsAllowed;
    var appSettings = window["android"] && window["android"]["openSettings"];
    if (appSettings || soundPermitted && chatango.managers.Environment.getInstance().isAndroidApp()) {
      if (opt_initSoundClick) {
        return;
      }
      var src;
      if (typeof url == "string") {
        src = url;
      } else {
        if (url.length) {
          src = url[0];
        }
      }
      chatango.embed.AppComm.getInstance().alertSound(src, stream);
      return;
    }
    if (soundPermitted && chatango.managers.Environment.getInstance().isAndroid()) {
      if (document.webkitVisibilityState == "hidden" && this.model_.getMutedWhenHidden()) {
        soundPermitted = false;
      }
    }
    if (this.soundEnabled_ && soundPermitted) {
      if (opt_initSoundClick) {
        audio.volume = .1;
      }
      audio.play();
      if (opt_initSoundClick) {
        audio.pause();
        audio.volume = 1;
      }
    }
  } catch (e) {
    return;
  }
};
