  var inset = size * .06;
  var sm_radius = radius - inset;
  var color = opt_color ? opt_color : "#333333";
  var degrees = opt_degrees ? opt_degrees : 45;
  var strokeW = size / 17;
  var angle = isSad ? 270 : 90;
  var xPos = margin + size * .5;
  var yPos = isSad ? margin + size * .69 : margin + size * .78;
