chatango.smileys.Smiley = function(size, width, height, managers, opt_info, opt_domHelper) {
  goog.ui.Component.call(this, opt_domHelper);
  this.size_ = size ? size : chatango.managers.Style.getInstance().getIconSize();
  this.width_ = width;
  this.height_ = height;
  this.info_ = opt_info ? opt_info : "";
  this.managers_ = managers;
  this.autoAnimates_ = false;
  this.totalFrames_ = 6;
  this.animInterval_ = 30;
  var resources = managers.getManager("RESOURCE");
  resources.pushResource("SMILEY", this);
};
goog.inherits(chatango.smileys.Smiley, goog.ui.Component);
chatango.smileys.Smiley.listenTo_ = [goog.ui.Component.EventType.ACTION, goog.ui.Component.EventType.ENTER, goog.events.EventType.MOUSEOVER, goog.events.EventType.CLICK];
