chatango.smileys.Smiley.prototype.createDom = function() {
  var outer;
  var inner;
  var w = Math.round(this.width_);
  var h = Math.round(this.height_);
  var sm_padding = Math.floor(w / 10);
  if (w == 0 || h == 0) {
    return;
  }
  var viewboxW = this.info_.smObj && this.info_.smObj["w"] ? this.info_.smObj["w"] * 100 : 100;
  var viewboxH = this.info_.smObj && this.info_.smObj["h"] ? this.info_.smObj["h"] * 100 : 100;
  var viewboxX = this.info_.smObj && this.info_.smObj["x"] ? this.info_.smObj["x"] * 100 : 0;
  var viewboxY = this.info_.smObj && this.info_.smObj["y"] ? this.info_.smObj["y"] * 100 : 0;
  var top = Math.floor(1 + h * chatango.smileys.Smiley.Y_OFFSET);
  if (viewboxH != 100 || viewboxY != 0) {
    top += Math.floor((viewboxH - 100 + viewboxY) / 100 * h * (100 / viewboxH));
  }
  var outer = goog.dom.createDom("div", {"style":"width:" + w + "px; height:" + h + "px; padding: 0 " + sm_padding + "px; position:relative; top: " + top + "px;", "class":"smiley"});
  this.svg_ = chatango.utils.svg.createSvg({"width":w + "px", "height":h + "px", "viewBox":viewboxX + ", " + viewboxY + ", " + viewboxW + ", " + viewboxH});
  goog.dom.appendChild(outer, this.svg_);
  this.setElementInternal(outer);
  this.cover_ = goog.dom.createDom("div");
  goog.style.setStyle(this.cover_, {"width":"100%", "height":"100%", "background-color":"rgba(0, 0, 0, 0)", "position":"absolute", "top":"0", "left":"0"});
  goog.dom.appendChild(outer, this.cover_);
  this.drawStaticElements_();
  this.drawFrame();
};
chatango.smileys.Smiley.prototype.drawStaticElements_ = function() {
  this.bg_ = chatango.utils.svg.createSvgElement("circle", {"cx":"50", "cy":"50", "r":"50"});
  goog.dom.appendChild(this.svg_, this.bg_);
};
chatango.smileys.Smiley.prototype.enterDocument = function() {
  chatango.smileys.Smiley.superClass_.enterDocument.call(this);
  goog.events.listen(this.element_, chatango.smileys.Smiley.listenTo_, this.smileyEvent, false, this);
  if (this.autoAnimates_) {
    this.animate();
  }
};
chatango.smileys.Smiley.prototype.animate = function() {
  this.currentFrame_ = 0;
  this.removeTimer_();
  this.timer_ = new goog.Timer(this.getAnimInterval());
  goog.events.listen(this.timer_, goog.Timer.TICK, this.advanceFrame, false, this);
  this.timer_.start();
  this.drawFrame();
};
chatango.smileys.Smiley.prototype.removeTimer_ = function() {
  if (this.timer_ != null) {
    this.timer_.stop();
    this.timer_.dispose();
  }
};
chatango.smileys.Smiley.prototype.advanceFrame = function(e) {
  this.currentFrame_++;
  if (this.currentFrame_ >= this.getTotalFrames()) {
    goog.events.unlisten(this.timer_, goog.Timer.TICK, this.advanceFrame, false, this);
    this.timer_.stop();
    this.timer_.dispose();
  }
  this.drawFrame();
};
chatango.smileys.Smiley.prototype.drawFrame = function() {
};
chatango.smileys.Smiley.prototype.smileyEvent = function(e) {
  this.animate();
};
chatango.smileys.Smiley.prototype.disposeInternal = function() {
  goog.events.unlisten(this.element_, chatango.smileys.Smiley.listenTo_, this.smileyEvent, false, this);
  this.removeTimer_();
  var resources = this.managers_.getManager("RESOURCE");
  if (chatango.DEBUG) {
    this.logger.info("Removing smiley resource");
  }
  resources.removeResource("SMILEY", this);
  this.sm_ = null;
  this.info_ = null;
  chatango.smileys.Smiley.superClass_.disposeInternal.call(this);
};
