goog.provide("chatango.smileys.svg.Team");
goog.require("chatango.smileys.Smiley");
goog.require("goog.ui.Component");
chatango.smileys.svg.Team = function(size, width, height, managers, opt_info, opt_domHelper) {
  chatango.smileys.Smiley.call(this, size, width, height, managers, opt_info, opt_domHelper);
  this.autoAnimates_ = true;
  this.metadata_ = this.info_["metadata"] || "";
  var md_arr = this.metadata_.split(":");
  if (md_arr[0] == "random") {
    var len = Math.ceil(Math.round(Math.random() * 5)) + 1;
    var i;
    var cols = [];
    for (i = 0;i < len;i++) {
      cols.push(chatango.utils.color.getRandomColor());
    }
    md_arr[0] = cols.join(",");
    md_arr[1] = Math.round(Math.random() * 360);
    md_arr[2] = Math.ceil(Math.round(Math.random() * 10));
  }
  this.angle_ = md_arr[1] && !isNaN(Number(md_arr[1])) ? md_arr[1] : 0;
  this.repeat_ = md_arr[2] && !isNaN(Number(md_arr[2])) ? Math.min(Math.abs(Math.round(md_arr[2])), 10) : 1;
  var colArr = md_arr[0] ? md_arr[0].split(",") : [];
  this.colors_ = [];
  for (var i = 0;i < colArr.length;i++) {
    if (goog.color.isValidColor(colArr[i])) {
      this.colors_.push(colArr[i]);
    }
  }
  if (this.colors_.length == 0) {
    this.colors_ = ["#FF0000"];
  }
  this.patternId_ = "p" + md_arr.join(",").split("#").join("Z").split(",").join("z");
};
