  var stripeHeight = 100 / this.repeat_ / len;
  var pattern = chatango.utils.svg.createSvgElement("pattern", {"id":this.patternId_, "patternTransform":"rotate(" + this.angle_ + ")", "patternUnits":"userSpaceOnUse", "width":100, "height":stripeHeight * len});
