chatango.smileys.svg.Hmmm.prototype.drawFrame = function() {
  if (this.hand_) {
    goog.dom.removeNode(this.hand_);
    this.hand_ = null;
  }
  if (this.smile_) {
    goog.dom.removeNode(this.smile_);
    this.smile_ = null;
  }
  var degrees = 10 + this.currentFrame_ * 2;
  this.smile_ = chatango.smileys.SmileySvgUtil.getSmileySmile("#333333", degrees);
  goog.dom.appendChild(this.svg_, this.smile_);
  this.hand_ = this.getHand(this.currentFrame_);
  goog.dom.appendChild(this.wrap_, this.hand_);
  chatango.utils.svg.setElementAttributes(this.hand_, {"transform":"scale(1.2) translate(5,83) rotate(15 0 0)"});
  var percent = this.currentFrame_ / this.totalFrames_;
  var degree = 0 + percent * 20;
  chatango.utils.svg.setElementAttributes(this.wrap_, {"transform":"rotate(" + degree + " 50 50)"});
};
