chatango.smileys.svg.Ninja.prototype.onMouseMove_ = function(e) {
  if (!this.getElement()) {
    return;
  }
  if (this.eyes_) {
    var x = (e.clientX - goog.style.getPageOffsetLeft(this.getElement())) / window.innerWidth;
    var y = (e.clientY - goog.style.getPageOffsetTop(this.getElement())) / window.innerHeight;
    var xMax = 25;
    var yMax = 10;
    var xPos = Math.max(Math.min(x * 25, xMax), -xMax);
    var yPos = Math.max(Math.min(y * 10, yMax), -yMax);
    chatango.utils.svg.setElementAttributes(this.eyes_, {"transform":"translate(" + xPos + ", " + yPos + ")"});
  }
};
chatango.smileys.svg.Ninja.prototype.drawFrame = function() {
  if (this.eyesTimer_) {
    return;
  }
  var tf = this.totalFrames_;
  var i = this.currentFrame_;
  if (!i) {
    return;
  }
  var quarter = Math.round(tf / 4);
  var currentQuarter = Math.floor(i / tf * 4);
  var pos;
  switch(currentQuarter) {
    case 0:
      pos = -i;
      break;
    case 1:
      pos = -quarter + i % quarter;
      break;
    case 2:
      pos = Math.round(i - tf / 2);
      break;
    case 3:
    ;
    default:
      pos = tf - i;
  }
  var xOffset = pos * 6;
  if (!this.eyes_) {
    return;
  }
  chatango.utils.svg.setElementAttributes(this.eyes_, {"transform":"translate(" + xOffset + ",0)"});
  if (i == tf - 1 && !this.hasListenedForEyes_) {
    this.hasListenedForEyes_ = true;
    if (chatango.managers.Environment.getInstance().isDesktop()) {
      goog.events.listen(window, goog.events.EventType.MOUSEMOVE, this.onMouseMove_, false, this);
      this.eyesTimer_ = new goog.Timer(90 * 1E3);
      goog.events.listen(this.eyesTimer_, goog.Timer.TICK, this.stopListeningForMouseMove_, false, this);
      this.eyesTimer_.start();
    }
  }
  chatango.smileys.svg.Ninja.prototype.disposeInternal = function() {
    chatango.smileys.svg.Ninja.prototype.stopListeningForMouseMove_();
    chatango.smileys.svg.Ninja.prototype.removeEyesTimer_();
    chatango.smileys.svg.Ninja.superClass_.disposeInternal.call(this);
  };
};
