  this.managers_ = managers;
  this.thumbSrc_ = src;
  this.src_ = src.replace(new RegExp("^(//ust." + this.managers_.getManager(chatango.settings.servers.BaseDomain.ManagerType).getBaseDomain() + "/um/[0-9a-zA-Z]/[0-9a-zA-Z]/[0-9a-zA-Z]{1,20}/img/)t_([0-9]+.jpg)$"), "$1l_$2");
