chatango.messagedata.GroupMsgFormatter.TAG_WHITELIST = ["p", "u", "b", "i", "br", "f", "atreply", "atquote"];
chatango.messagedata.GroupMsgFormatter.MAX_IMAGES = 3;
chatango.messagedata.GroupMsgFormatter.MAX_VIDEOS = 1;
chatango.messagedata.GroupMsgFormatter.prototype.handleAtReplies_ = function() {
  var atWithOptQuoteRegGreedy = /@([a-zA-Z0-9]+)(?:\: `.*?`)?/g;
  var atWithOptQuoteReg = /@([a-zA-Z0-9]+)\: `([^`]*)`?/;
  var quoteReg = /`.*?`/;
  var beforeReg = /(\s+|[>])/;
  var afterReg = /(\s+|[<\:\,\;\!\?\.\)])/;
  this.messageHtml_ = this.messageHtml_.replace(atWithOptQuoteRegGreedy, function(match, sid, index, full) {
    var before = full[index - 1] || " ";
    var after = full[index + match.length] || " ";
    if (quoteReg.exec(match)) {
      var resultWithQuote = match.match(atWithOptQuoteReg);
      return "<atquote><atreply>@" + resultWithQuote[1] + "</atreply>: " + resultWithQuote[2] + "</atquote>";
    } else {
      if (beforeReg.exec(before) && afterReg.exec(after)) {
        return "<atreply>" + match + "</atreply>";
      } else {
        return match;
      }
    }
  });
};
chatango.messagedata.GroupMsgFormatter.prototype.parseTag_ = function() {
  var type = chatango.messagedata.BaseMsgFormatter.TagType.OPENING;
  var name = "";
  this.parserAdvance_(1);
  var c = this.getChar_();
  if (c == "/") {
    type = chatango.messagedata.BaseMsgFormatter.TagType.CLOSING;
    this.parserAdvance_(1);
    c = this.getChar_();
  }
  name = this.parseTagName_();
  attributes = this.parseTagAttributes_();
  if (!attributes) {
    return false;
  }
  c = this.getChar_();
  if (c == "/") {
    if (type == chatango.messagedata.BaseMsgFormatter.TagType.CLOSING) {
      if (chatango.DEBUG) {
        console.info("Parse error at: " + this.messageHtml_.substring(this.parserPosition_));
      }
      return false;
    }
    type = chatango.messagedata.BaseMsgFormatter.TagType.SELF_CLOSING;
    this.parserAdvance_(1);
    c = this.getChar_();
  }
  if (c != ">") {
    if (chatango.DEBUG) {
      console.info("Parse error at: " + this.messageHtml_.substring(this.parserPosition_));
    }
    return false;
  }
  this.parserAdvance_(1);
  if (name.toLowerCase() == "p") {
    if (type == chatango.messagedata.BaseMsgFormatter.TagType.OPENING) {
      if (!this.parserBlockAllowed_) {
        if (chatango.DEBUG) {
          console.info("Parse error: p tag not allowed here");
        }
        return false;
      } else {
        this.parserBlockAllowed_ = false;
      }
    }
    if (type == chatango.messagedata.BaseMsgFormatter.TagType.CLOSING) {
      this.parserBlockAllowed_ = true;
    }
  }
  if (name.toLowerCase() == "f" && type == chatango.messagedata.BaseMsgFormatter.TagType.OPENING) {
    if (this.inFTag_) {
      var top = this.parserStack_[this.parserStack_.length - 1];
      if (top.name.toLowerCase() != "f") {
        if (chatango.DEBUG) {
          console.info("Nested f tag encountered when previous f tag is not on top of tag stack.");
        }
        return false;
      }
      this.parserStack_.pop();
    } else {
      this.inFTag_ = true;
    }
  }
  if (!goog.array.contains(chatango.messagedata.GroupMsgFormatter.TAG_WHITELIST, name.toLowerCase())) {
    if (chatango.DEBUG) {
      console.info("tag " + name + " not in whitelist");
    }
    return true;
  }
  node = {"children":[], "name":name, "attributes":attributes};
  node.name = name;
  node.attributes = attributes;
  var top = this.parserStack_[this.parserStack_.length - 1];
  if (type == chatango.messagedata.BaseMsgFormatter.TagType.OPENING) {
    top.children.push(node);
    this.parserStack_.push(node);
  } else {
    if (type == chatango.messagedata.BaseMsgFormatter.TagType.CLOSING) {
      if (name != top.name && top.name.toLowerCase() == "f") {
        this.parserStack_.pop();
        this.inFTag_ = false;
        top = this.parserStack_[this.parserStack_.length - 1];
      }
      if (name != top.name) {
        if (chatango.DEBUG) {
          console.info('Found "' + name + '", expected "' + top.name + '"');
        }
        return false;
      }
      this.parserStack_.pop();
    } else {
      if (type == chatango.messagedata.BaseMsgFormatter.TagType.SELF_CLOSING) {
        top.children.push(node);
      }
    }
  }
  return true;
};
chatango.messagedata.GroupMsgFormatter.prototype.isYoutubeLink = function(token) {
  return token.match(chatango.utils.formatting.YOUTUBE_HREF_GRP_REGEX);
};
chatango.messagedata.GroupMsgFormatter.prototype.linkFragmentsBanned = function() {
  var groupInfo = this.managers_.getManager(chatango.group.GroupInfo.ManagerType);
  return!groupInfo.getChatangoAllowsLinks();
};
chatango.messagedata.GroupMsgFormatter.prototype.linksAllowed = function() {
  var groupInfo = this.managers_.getManager(chatango.group.GroupInfo.ManagerType);
  return groupInfo.getAllowLinks() && groupInfo.getChatangoAllowsLinks();
};
chatango.messagedata.GroupMsgFormatter.prototype.processNode_ = function(node) {
  if (!node.name) {
    return;
  }
  var elt;
  var component;
  node.name = node.name.toLowerCase();
  if (node.name == "p") {
    elt = goog.dom.createDom("p");
    this.appendDom_(elt);
    node.element = elt;
  } else {
    if (node.name == "u") {
      elt = goog.dom.createDom("u");
      this.appendDom_(elt);
      node.element = elt;
    } else {
      if (node.name == "b") {
        elt = goog.dom.createDom("b");
        this.appendDom_(elt);
        node.element = elt;
      } else {
        if (node.name == "i") {
          elt = goog.dom.createDom("i");
          this.appendDom_(elt);
          node.element = elt;
        } else {
          if (node.name == "br") {
            elt = goog.dom.createDom("br");
            this.appendDom_(elt);
            node.element = elt;
          } else {
            if (node.name == "f") {
              this.processFTag_(node);
            } else {
              if (node.name == "atreply") {
                elt = goog.dom.createDom("span", {"class":"at-reply"});
                node.element = elt;
                this.appendDom_(elt);
              } else {
                if (node.name == "atquote") {
                  elt = goog.dom.createDom("span", {"class":"at-quote"});
                  node.element = elt;
                  this.appendDom_(elt);
                } else {
                  if (node.name == "ct:text") {
                    this.appendDom_(node.value);
                  } else {
                    if (node.name == "ct:image") {
                      this.processImageLink(node);
                    } else {
                      if (node.name == "ct:youtube") {
                        this.processYoutubeLink(node);
                      } else {
                        if (node.name == "ct:link") {
                          this.processLink(node);
                        } else {
                          if (node.name == "ct:cm") {
                            this.processCMMessage(node);
                          } else {
                            if (node.name == "ct:smiley") {
                              this.processSmiley(node);
                            } else {
                              if (node.name == "ct:link_fragment") {
                                this.processLinkFragment(node);
                              } else {
                                if (chatango.DEBUG) {
                                  console.info("Unrecognized tag name: " + node.name);
                                }
                              }
                            }
                          }
                        }
                      }
                    }
                  }
                }
              }
            }
          }
        }
      }
    }
  }
  node.created = true;
};
chatango.messagedata.GroupMsgFormatter.prototype.processFTag_ = function(node) {
  var elt;
  var groupInfo = this.managers_.getManager(chatango.group.GroupInfo.ManagerType);
  if (!groupInfo.getAllowStyledText() || this.stylesDisabled_) {
    elt = goog.dom.createDom("span");
    node.element = elt;
    this.appendDom_(elt);
    return;
  }
  var name, pos, size, hex, fontIndex;
  var style = "";
  for (name in node.attributes) {
    if (node.attributes.hasOwnProperty(name)) {
      pos = 0;
      if (name[pos] != "x") {
        continue;
      }
      pos++;
      if (name.length == 9 || name.length == 6) {
        size = name.substr(pos, 2);
        if (!size.match(/\d\d/)) {
          continue;
        }
        if (size > 14 && !(this.authorIsOwner_ || this.isPremium_)) {
          continue;
        }
        pos += 2;
        if (pos < name.length) {
          hex = name.substr(pos);
          if (!hex.match(/[0-9a-fA-F]+/)) {
            continue;
          }
          hex = chatango.utils.color.expandHex(hex);
        }
      } else {
        if (name.length == 7 || name.length == 4 || name.length == 2) {
          hex = chatango.utils.color.expandHex(name.substr(pos));
        } else {
          if (name.length == 3) {
            size = name.substr(pos);
          }
        }
      }
      style = "";
      if (size != undefined) {
        this.currentFontSize_ = chatango.utils.formatting.scaleSize(size);
        style += "font-size:" + this.currentFontSize_ + "%;";
      }
      if (hex != undefined) {
        style += "color:#" + hex + ";";
      }
      fontIndex = node.attributes[name];
      if (fontIndex && fontIndex.length > 0) {
        style += "font-family:" + this.getFont(fontIndex);
      }
    }
  }
  elt = goog.dom.createDom("span", {"style":style});
  node.element = elt;
  this.appendDom_(elt);
};
chatango.messagedata.GroupMsgFormatter.prototype.processImageLink = function(node) {
  goog.base(this, "processImageLink", node);
  if (this.noThumbs_) {
    return;
  }
  var src = node.attributes ? node.attributes.src : node.value;
  if (!this.checkURI(src)) {
    node.element = goog.dom.createTextNode(src);
    this.appendDom_(node.element);
    return;
  }
  var groupInfo = this.managers_.getManager(chatango.group.GroupInfo.ManagerType);
  if (!groupInfo.getAllowImages()) {
    this.processLink(node);
    return;
  }
  if (this.messageData_.getUserType() != chatango.users.User.UserType.SELLER) {
    this.processLink(node);
    return;
  }
  this.imageLinks_ += 1;
  if (this.imageLinks_ > chatango.messagedata.GroupMsgFormatter.MAX_IMAGES) {
    this.processLink(node);
    return;
  }
  var scale = chatango.managers.Style.getInstance().getScale();
  var w = Math.round(133 * scale / 100);
  var h = Math.round(100 * scale / 100);
  var thumb = new chatango.ui.Thumbnail(node.value, w, h, this.managers_);
  node.element = thumb.getElement();
  this.appendComponent_(thumb);
};
chatango.messagedata.GroupMsgFormatter.prototype.processYoutubeLink = function(node) {
  var groupInfo = this.managers_.getManager(chatango.group.GroupInfo.ManagerType);
  if (groupInfo.getAllowVideos()) {
    if (this.noThumbs_) {
      return;
    }
    this.youtubeLinks_ += 1;
    if (this.youtubeLinks_ > chatango.messagedata.GroupMsgFormatter.MAX_VIDEOS) {
      this.processLink(node);
      return;
    }
    var rawMsg = node.value;
    var videoid = rawMsg.match(chatango.utils.formatting.YOUTUBE_HREF_GRP_REGEX);
    var component = new chatango.ui.Youtube(videoid[1], rawMsg, this.managers_);
    node.element = component.getElement();
    this.appendComponent_(component);
  } else {
    this.processLink(node);
  }
};
chatango.messagedata.GroupMsgFormatter.prototype.processLink = function(node) {
  var elt;
  if (this.linksAllowed()) {
    var uri = node.value;
    if (uri.match(chatango.utils.formatting.WWW_REGEX)) {
      uri = "http://" + uri;
    }
    if (uri.match(chatango.utils.formatting.AMAZON_REGEX)) {
      if (uri.match(chatango.utils.formatting.TAG_REGEX)) {
      } else {
        if (uri.match(chatango.utils.formatting.GET_REGEX)) {
          uri = uri + "&tag=chatangocom-20";
        } else {
          uri = uri + "/?tag=chatangocom-20";
        }
      }
    }
    if (node.value.length < 256) {
      elt = goog.dom.createDom("a", {"href":uri, "target":"_blank"}, node.value);
    } else {
      elt = goog.dom.createDom("span", {}, node.value);
    }
  } else {
    elt = goog.dom.createTextNode("*");
  }
  node.element = elt;
  this.appendDom_(elt);
};
