chatango.managers.MessageStyleManager.prototype.saveToServer_ = function() {
  if (this.requestActive_) {
    this.requestQueued_ = true;
    return;
  }
  var baseDomain = this.managers_.getManager(chatango.settings.servers.BaseDomain.ManagerType).getBaseDomain();
  var uploadUrl = "//" + baseDomain + "/updatemsgstyles";
  var xhr = chatango.networking.RequestFactory.getInstance().makeRequest(uploadUrl, true);
  var fd = new FormData;
  var username = goog.net.cookies.get("un") || "";
  var password = goog.net.cookies.get("pw") || "";
  if (username != "") {
    var encoder = chatango.utils.Encode.getInstance();
    username = encoder.decode(username);
    password = encoder.decode(password);
  } else {
    return;
  }
  fd.append("lo", username);
  fd.append("p", password);
  fd.append("hasrec", chatango.managers.ServerTime.getInstance().getServerTime());
  for (var key in this.flags_) {
    fd.append(key, this.flags_[key]);
  }
  goog.events.listen(xhr, goog.net.EventType.SUCCESS, this.onSaveSuccess_, undefined, this);
  goog.events.listen(xhr, [goog.net.EventType.ERROR, goog.net.EventType.TIMEOUT, goog.net.EventType.ABORT], this.onSaveSuccess_, undefined, this);
  xhr.send(uploadUrl, "POST", fd);
  this.requestActive_ = true;
};
chatango.managers.MessageStyleManager.prototype.onSaveSuccess_ = function(e) {
  this.requestActive_ = false;
  if (this.requestQueued_) {
    this.requestQueued_ = false;
    this.saveToServer_();
  }
};
