chatango.managers.DateManager.prototype.diffToString = function(start, end, length, showSeconds) {
  length = length !== undefined ? length : 2;
  var s = ~~((end - start) / 1E3);
  var years = ~~(s / 60 / 60 / 24 / 365);
  var days = ~~(s / 60 / 60 / 24 - 365 * years);
  var hours = ~~(s / 60 / 60 - 24 * (days + 365 * years));
  var mins = ~~(s / 60 - 60 * (hours + 24 * (days + 365 * years)));
  var secs = ~~(s - 60 * (mins + 60 * (hours + 24 * (days + 365 * years))));
  if (years > 0 || days >= 100) {
    return "100+ days";
  }
  var result = [];
  var curStr = "";
  var space = length > 0 ? "&nbsp;" : "";
  if (years > 0) {
    curStr = years.toString() + space;
    curStr += years > 1 ? this.lm_.getString("date_time", "years").split(",")[length] : this.lm_.getString("date_time", "year").split(",")[length];
    result.push(curStr);
  }
  if (days > 0) {
    curStr = days.toString() + space;
    curStr += days > 1 ? this.lm_.getString("date_time", "days").split(",")[length] : this.lm_.getString("date_time", "day").split(",")[length];
    result.push(curStr);
  }
  if (hours > 0) {
    curStr = hours.toString() + space;
    curStr += hours > 1 ? this.lm_.getString("date_time", "hours").split(",")[length] : this.lm_.getString("date_time", "hour").split(",")[length];
    result.push(curStr);
  }
  if (mins > 0) {
    curStr = mins.toString() + space;
    curStr += mins > 1 ? this.lm_.getString("date_time", "mins").split(",")[length] : this.lm_.getString("date_time", "min").split(",")[length];
    result.push(curStr);
  }
  if (secs > 0 && (mins === 0 && hours === 0 && days === 0 && years === 0 || showSeconds)) {
    curStr = secs.toString() + space;
    curStr += secs > 1 ? this.lm_.getString("date_time", "secs").split(",")[length] : this.lm_.getString("date_time", "sec").split(",")[length];
    result.push(curStr);
  }
  var message = result.splice(0, 2).join("&nbsp;");
  return message ? message : "just now";
};
