chatango.users.ModeratorManager.prototype.getModIcon = function(sid) {
  if (!sid) {
    return 0;
  }
  sid = sid.toLowerCase();
  if (!this.isModerator(sid)) {
    return 0;
  }
  if (this.isOwner(sid)) {
    return goog.net.cookies.get(this.handle_ + "_icon_setting", 0);
  }
  var flags = this.mods_[sid];
  if (flags & chatango.group.moderation.Permissions.Flags.STAFF_ICON_VISIBLE) {
    return chatango.group.moderation.Permissions.Flags.STAFF_ICON_VISIBLE;
  }
  if (flags & chatango.group.moderation.Permissions.Flags.MOD_ICON_VISIBLE) {
    return chatango.group.moderation.Permissions.Flags.MOD_ICON_VISIBLE;
  }
  return 0;
};
