chatango.output.OutputWindow.prototype.addMessage = function(message, opt_position) {
  var position = opt_position || "bottom";
  if (!message) {
    return;
  }
  var msg;
  switch(message.getMessageType()) {
    case chatango.messagedata.MessageData.MessageType.ANNC:
      msg = new chatango.group.AnnouncementMessage(message, this.managers_);
      break;
    case chatango.messagedata.MessageData.MessageType.GROUP:
      msg = this.getGroupMessage(message, position);
      if (!msg) {
        return;
      }
      break;
    case chatango.messagedata.MessageData.MessageType.PRIVATE:
      msg = this.getPrivateMessage(message);
      break;
    case chatango.messagedata.MessageData.MessageType.PRIVATE_HISTORY:
      msg = this.getPrivateMessage(message, undefined, true);
      break;
    case chatango.messagedata.MessageData.MessageType.SYSTEM:
      msg = this.getSystemMessage(message);
      break;
    default:
      return;
  }
  this.messageQueue_.push({"message":msg, "position":position});
  if (!this.queueActive_) {
    this.queueActive_ = true;
    var self = this;
    if (chatango.output.OutputWindow.QUEUE_MESSAGES) {
      setTimeout(function() {
        self.processMessageQueue();
      }, this.queuePeriod_);
    } else {
      setTimeout(function() {
        self.processMessageQueue();
      }, 0);
    }
  }
  this.msgIdMap[message.getId()] = msg;
};
